interface IDiscordStatus {
	display: string;
	htmlIcon: JSX.Element | null;
}

export default class DiscordStatus {
	static readonly DND = new DiscordStatus('DND', {
		display: 'Do Not Disturb',
		htmlIcon: (
			<div className="w-5 h-5 bg-red-500 rounded-full font-mono flex items-center justify-center">
				<svg
					viewBox="0 0 24 24"
					width="16"
					height="16"
					stroke="black"
					stroke-width="3"
					fill="none"
					stroke-linecap="round"
					stroke-linejoin="round"
					data-darkreader-inline-fill=""
					data-darkreader-inline-stroke=""
				>
					<line x1="5" y1="12" x2="19" y2="12"></line>
				</svg>
			</div>
		),
	});
	static readonly IDLE = new DiscordStatus('IDLE', {
		display: 'Idle',
		htmlIcon: (
			<img
				src="https://emoji.gg/assets/emoji/3929_idle.png"
				style={{ width: '16px', height: '16px' }}
			/>
		),
	});
	static readonly ONLINE = new DiscordStatus('ONLINE', {
		display: 'Online',
		htmlIcon: (
			<div className="w-5 h-5 bg-green-500 rounded-full font-mono flex items-center justify-center" />
		),
	});
	static readonly OFFLINE = new DiscordStatus('OFFLINE', {
		display: 'Offline',
		htmlIcon: (
			<div className="w-5 h-5 bg-gray-500 rounded-full font-mono flex items-center justify-center" />
		),
	});

	// private to disallow creating other instances of this type
	private constructor(
		private readonly key: string,
		public readonly value: IDiscordStatus
	) {}

	toString() {
		return this.key;
	}
}
